import axios from "axios";

export function getFormulaire() {
    return axios.get('http://127.0.0.1:8000/Formulaire/')
        .then(res => {
            // Extract and return the data from the response
            return res.data;
        })
        .catch(error => {
            // Handle errors
            throw error;
        });
}

export function addFormulaire(formulaire) {
    return axios.post('http://127.0.0.1:8000/Formulaire/', {
        nom: formulaire.nom,
        prenom: formulaire.prenom,
        mail: formulaire.mail,
     })
    .then(res => {
        // Extract and return the data from the response
        return res.data;
    })
   
}
